import React, { useState } from "react";
import FileUpload from "./FileUpload";
import DatabaseSTS from "./DatabaseSTS";
import "../App.css";

function LoadSTS() {
  const [selectedOption, setSelectedOption] = useState("");

  const handleOptionChange = (event) => {
    setSelectedOption(event.target.value);
  };

  return (
    <form className="form">
      <th className="th">
        <input
          type="radio"
          value="uploadSTS"
          checked={selectedOption === "uploadSTS"}
          onChange={handleOptionChange}
          Checked
        />
        &nbsp; Upload STS &emsp; &emsp; &emsp;
        <input
          type="radio"
          value="databaseSTS"
          checked={selectedOption === "databaseSTS"}
          onChange={handleOptionChange}
        />
        &nbsp; Load STS from Database
      </th>

      {selectedOption === "uploadSTS" && <FileUpload />}
      {selectedOption === "databaseSTS" && <DatabaseSTS />}
    </form>
  );
}

export default LoadSTS;
